with recursive page as (
select
    ck_id
from
    s_mt.t_page
where
    ck_id = '5'
union all
select
    p.ck_id
from
    s_mt.t_page p
join page rp on
    p.ck_parent = rp.ck_id )
delete
from
    s_mt.t_page_action ap
where ap.ck_page in (select ck_id from page);
